      out.write("\tfunction stringToJsTime_(timeString) {\r\n");
      out.write("\t\tif(timeString != null && timeString != '' && typeof(timeString) != 'undefined'){\r\n");
      out.write("\t\t\tvar y = timeString.substring(0,4);\r\n");
