      out.write("\tfunction dateminus(date1,date2){\r\n");
      out.write("\t\tvar date3=date2.getTime()-date1.getTime();  //时间差的毫秒数\r\n");
      out.write("\r\n");
      out.write("\t      //计算出相差天数\r\n");
      out.write("\t        var days=Math.floor(date3/(24*3600*1000));\r\n");
      out.write("\r\n");
      out.write("\t        //计算出小时数\r\n");
      out.write("\r\n");
      out.write("\t        var leave1=date3%(24*3600*1000) ;   //计算天数后剩余的毫秒数\r\n");
      out.write("\t        var hours=Math.floor(leave1/(3600*1000));\r\n");
      out.write("\t        //计算相差分钟数\r\n");
      out.write("\t        var leave2=leave1%(3600*1000)   ;     //计算小时数后剩余的毫秒数\r\n");
      out.write("\t        var minutes=Math.floor(leave2/(60*1000));\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("\t        //计算相差秒数\r\n");
      out.write("\t        var leave3=leave2%(60*1000)    ;  //计算分钟数后剩余的毫秒数\r\n");
      out.write("\t        var seconds=Math.round(leave3/1000);\r\n");
      out.write("\t        if(hours.length<2){\r\n");
      out.write("\t        \thours = \"0\"+\"\"+hours;\r\n");
      out.write("\t        }\r\n");
      out.write("\t        if(minutes.length<2){\r\n");
      out.write("\t        \tminutes = \"0\"+\"\"+minutes;\r\n");
      out.write("\t        }\r\n");
      out.write("\t        if(seconds.length<2){\r\n");
      out.write("\t        \tseconds = \"0\"+\"\"+seconds;\r\n");
      out.write("\t        }\r\n");
      out.write("\t        showTiming2(hours,minutes,seconds);\r\n");
      out.write("\t        //$(\"#timing\").html(hours+\":\"+minutes+\":\"+seconds);\r\n");
      out.write("\t}\r\n");
      out.write("\t  function showTiming2(h,m,s){\r\n");
      out.write("    \t  var HH = h;\r\n");
      out.write("    \t  var mm = m;\r\n");
      out.write("    \t  var ss = s;\r\n");
      out.write("    \t  var str = '';\r\n");
      out.write("\r\n");
      out.write("    \t  str = \"\";\r\n");
      out.write("\r\n");
      out.write("    \t  if(++ss==60)\r\n");
      out.write("    \t  {\r\n");
      out.write("    \t  if(++mm==60)\r\n");
      out.write("    \t  {\r\n");
      out.write("    \t  HH++;\r\n");
      out.write("    \t  mm=0;\r\n");
      out.write("    \t  }\r\n");
      out.write("    \t  ss=0;\r\n");
      out.write("    \t  }\r\n");
      out.write("\r\n");
      out.write("    \t  str+=HH<10?\"0\"+HH:HH;\r\n");
      out.write("    \t  str+=\":\";\r\n");
      out.write("    \t  str+=mm<10?\"0\"+mm:mm;\r\n");
      out.write("    \t  str+=\":\";\r\n");
      out.write("    \t  str+=ss<10?\"0\"+ss:ss;\r\n");
      out.write("    \t  document.getElementById(\"timing\").innerHTML = str;\r\n");
      out.write("\r\n");
      out.write("      }\r\n");
