      out.write("function encrypt(str, pwd) {\r\n");
      out.write("  if(pwd == null || pwd.length <= 0) {\r\n");
      out.write("    console.log(\"Please enter a password with which to encrypt the message.\");\r\n");
      out.write("    return null;\r\n");
      out.write("  }\r\n");
      out.write("  var prand = \"\";\r\n");
      out.write("  for(var i=0; i<pwd.length; i++) {\r\n");
      out.write("    prand += pwd.charCodeAt(i).toString();\r\n");
      out.write("  }\r\n");
      out.write("  var sPos = Math.floor(prand.length / 5);\r\n");
      out.write("  var mult = parseInt(prand.charAt(sPos) + prand.charAt(sPos*2) + prand.charAt(sPos*3) + prand.charAt(sPos*4) + prand.charAt(sPos*5));\r\n");
      out.write("  var incr = Math.ceil(pwd.length / 2);\r\n");
      out.write("  var modu = Math.pow(2, 31) - 1;\r\n");
      out.write("  if(mult < 2) {\r\n");
      out.write("    console.log(\"Algorithm cannot find a suitable hash. Please choose a different password. \\nPossible considerations are to choose a more complex or longer password.\");\r\n");
      out.write("    return null;\r\n");
      out.write("  }\r\n");
      out.write("  var salt = Math.round(Math.random() * 1000000000) % 100000000;\r\n");
      out.write("  prand += salt;\r\n");
      out.write("  while(prand.length > 10) {\r\n");
      out.write("    prand = (parseInt(prand.substring(0, 10)) + parseInt(prand.substring(10, prand.length))).toString();\r\n");
      out.write("  }\r\n");
      out.write("  prand = (mult * prand + incr) % modu;\r\n");
      out.write("  var enc_chr = \"\";\r\n");
      out.write("  var enc_str = \"\";\r\n");
      out.write("  for(var i=0; i<str.length; i++) {\r\n");
      out.write("    enc_chr = parseInt(str.charCodeAt(i) ^ Math.floor((prand / modu) * 255));\r\n");
      out.write("    if(enc_chr < 16) {\r\n");
      out.write("      enc_str += \"0\" + enc_chr.toString(16);\r\n");
      out.write("    } else enc_str += enc_chr.toString(16);\r\n");
      out.write("    prand = (mult * prand + incr) % modu;\r\n");
      out.write("  }\r\n");
      out.write("  salt = salt.toString(16);\r\n");
      out.write("  while(salt.length < 8)salt = \"0\" + salt;\r\n");
      out.write("  enc_str += salt;\r\n");
      out.write("  return enc_str;\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function decrypt(str, pwd) {\r\n");
      out.write("  if(str == null || str.length < 8) {\r\n");
      out.write("    console.log(\"A salt value could not be extracted from the encrypted message because it's length is too short. The message cannot be decrypted.\");\r\n");
      out.write("    return;\r\n");
      out.write("  }\r\n");
      out.write("  if(pwd == null || pwd.length <= 0) {\r\n");
      out.write("    console.log(\"Please enter a password with which to decrypt the message.\");\r\n");
      out.write("    return;\r\n");
      out.write("  }\r\n");
      out.write("  var prand = \"\";\r\n");
      out.write("  for(var i=0; i<pwd.length; i++) {\r\n");
      out.write("    prand += pwd.charCodeAt(i).toString();\r\n");
      out.write("  }\r\n");
      out.write("  var sPos = Math.floor(prand.length / 5);\r\n");
      out.write("  var mult = parseInt(prand.charAt(sPos) + prand.charAt(sPos*2) + prand.charAt(sPos*3) + prand.charAt(sPos*4) + prand.charAt(sPos*5));\r\n");
      out.write("  var incr = Math.round(pwd.length / 2);\r\n");
      out.write("  var modu = Math.pow(2, 31) - 1;\r\n");
      out.write("  var salt = parseInt(str.substring(str.length - 8, str.length), 16);\r\n");
      out.write("  str = str.substring(0, str.length - 8);\r\n");
      out.write("  prand += salt;\r\n");
      out.write("  while(prand.length > 10) {\r\n");
      out.write("    prand = (parseInt(prand.substring(0, 10)) + parseInt(prand.substring(10, prand.length))).toString();\r\n");
      out.write("  }\r\n");
      out.write("  prand = (mult * prand + incr) % modu;\r\n");
      out.write("  var enc_chr = \"\";\r\n");
      out.write("  var enc_str = \"\";\r\n");
      out.write("  for(var i=0; i<str.length; i+=2) {\r\n");
      out.write("    enc_chr = parseInt(parseInt(str.substring(i, i+2), 16) ^ Math.floor((prand / modu) * 255));\r\n");
      out.write("    enc_str += String.fromCharCode(enc_chr);\r\n");
      out.write("    prand = (mult * prand + incr) % modu;\r\n");
      out.write("  }\r\n");
      out.write("  return enc_str;\r\n");
      out.write("}\r\n");
      out.write("function flashChecker() {\r\n");
